import { useState } from 'react';

const Home = () => {
    const [name, setName] = useState('mario');


    const handleClick = () => {
        setName('luigi');
    }

    return (
        <div className="Home">
            <h2> Homepage </h2>
            <p> { name }</p>
            <button onClick={ handleClick }> Click me </button>
        </div>
    );
}
 
export default Home;
